import React from "react";
import { Image, Row, Container, Col } from "react-bootstrap";
import p1 from "./p1.jpg";
import p2 from "./p2.jpg";

function Home() {
  return (
    <div>
      <Container>
        <Row>
          <Col xs={6} md={4}>
            <Image src={p1} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={p2} roundedCircle />
          </Col>
          <Col xs={6} md={4}>
            <Image src="p1.jpg" thumbnail />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Home;
